import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://banner2.cleanpng.com/20180527/bhr/kisspng-docker-github-node-js-mongodb-computer-software-5b0a34af5cf459.9926378815273955033808.jpg" className="App-logo" alt="logo" />
        <p>
          Welcome to react app hosted on Docker
        </p>

      </header>
    </div>
  );
}

export default App;
